ton_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_telegram"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-telegram"></use></svg></div> <!----> <!----></div></div></button></div> <div class="absolute bottom-0 left-0 z-30"><button type="button" class="shadow-inner-white base-button base-button_theme_green base-button_view_rounded"><div class="base-button__effect"></div> <div class="base-button__content transition-fast"><!----> <div class="base-button__content-wrapper"><div class="base-button__side transition-fast"><svg width="28" height="28" xmlns="http://www.w3.org/2000/svg" class="icon sprite-icons svg-icon svg-icon_whatsapp"><use href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp" xlink:href="/_nuxt/2d0d2da8d9b310fc62ebc0eb312599b6.svg#i-whatsapp"></use></svg></div> <!----> <!----></div></div></button></div></div></div></div></div></div></div><script>window.__NUXT__=(function(a,b,c,d,e,f,g){return {layout:"default",data:[{post:{title:"Элементы и носители фирменного стиля",slug:"elementy-i-nositeli-firmennogo-stilya",shortDescription:"Представьте, что, прогуливаясь по&nbsp;улицам чужого города, вы&nbsp;увидели зеленую вывеску с&nbsp;красно-белым кругом. Чтобы узнать магазин, вам не&nbsp;придется подходить ближе и&nbsp;искать название. То&nbsp;же можно сказать и&nbsp;о&nbsp;продуктах. Вы&nbsp;сможете выбрать на&nbsp;полке супермаркета газированный напиток Fanta, если название будет на&nbsp;противоположной стороне банки? Наверняка! Удастся&nbsp;ли вам с&nbsp;первого раза назвать желто-черного оператора сотовой связи? Вне всяких сомнений!",createdAt:"2021-11-16T00:00:00+03:00",isImported:d,image:{file:{url:"\u002Fuploads\u002Ffile\u002F8\u002Fc\u002F4\u002F8c444671c0c7dce63169a9301ab766cb.png",name:"8c444671c0c7dce63169a9301ab766cb.png",originalName:"avatar.png",extension:"png",size:"315.2 Кб"}},content:{id:442,text:"\u003Cp\u003EПредставьте, что, прогуливаясь по&nbsp;улицам чужого города, вы&nbsp;увидели зеленую вывеску с&nbsp;красно-белым кругом. Чтобы узнать магазин, вам не&nbsp;придется подходить ближе и&nbsp;искать название. То&nbsp;же можно сказать и&nbsp;о&nbsp;продуктах. Вы&nbsp;сможете выбрать на&nbsp;полке супермаркета газированный напиток Fanta, если название будет на&nbsp;противоположной стороне банки? Наверняка! Удастся&nbsp;ли вам с&nbsp;первого раза назвать желто-черного оператора сотовой связи? Вне всяких сомнений!\u003C\u002Fp\u003E\r\n\u003Cp\u003EЭто заслуга фирменного стиля. Он&nbsp;делает бренды и&nbsp;продукты узнаваемыми, помогает дистанцироваться от&nbsp;конкурентов, облегчает покупателям процесс поиска и&nbsp;выбора товаров в&nbsp;супермаркете. Неудивительно, что каждый предприниматель рано или поздно задумывается о&nbsp;разработке фирменного стиля. Если вы&nbsp;тоже вплотную подошли к&nbsp;этому решению, то&nbsp;сегодняшняя статья для&nbsp;вас. В&nbsp;ней мы&nbsp;рассмотрим элементы фирстиля и&nbsp;основные виды носителей. Поехали!\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAcS2SURBVHgB7P0JvGVnXSd6\u002F5611h7PPnPVqVPzqSFJZZ6DDIEERQQVggJCvC1xaN\u002FW2zb2YPd92\u002Fd+SLp9bw\u002F2FdTut9u3WxG1RVAhyKAoQsIQIITMc1LzXKfOPOxprfXc\u002F\u002F95nrXPLqAVNCQ1\u002FL7lZk9r2vsEPPXL\u002F\u002F9\\u002F7j59oXPzfbec2uenLZlrHS4s4J89wrdsQfNsa0QUREdB5igEVEREQUTL7DTmUZRozBVBRhRF7abo08t+6xmnLP0XsO2XbErr3\u002FLck287LNfO8FiwPuTl6XY88X9\u002FLSwTzHvJxbHx848UfmAIj6vOfDtvxX89P\u002F6em5+B9vHKiYV44m6JoYu8cjvGIq+vMNY\u002Fjpy9ab4yAiIjrPMMAiIiKiC4YGVBIQXaPhlIRGV2swJffXhEBqCmenAxp4hZDrYSPhls3xCBhwXXDe9uETOx45kv7280vRrTZKgCwGOhHGSjF+4ooado1FuGjS