3EСоставляющие корпоративного стиля\u003C\u002Fh3\u003E\r\n\u003Cp\u003EФирменный стиль&nbsp;&mdash; набор визуальных элементов, которые в&nbsp;любой ситуации остаются неизменными и&nbsp;обеспечивают узнаваемость компании или ее&nbsp;продукта. Точный список составляющих зависит от&nbsp;сферы деятельности организации, а&nbsp;также других особенностей бренда, поэтому всегда подбирается индивидуально. Но&nbsp;если говорить об&nbsp;основных элементах фирстиля, то&nbsp;прежде всего следует выделить:\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E1. Логотип. \u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EОн&nbsp;есть почти у&nbsp;каждой компании и&nbsp;именно его можно считать лицом бренда. Хороший лого сочетает такие качества, как уникальность, запоминаемость, простота, привлекательность дизайна. Отличный объединяет в&nbsp;себе идеологию компании и&nbsp;отражает ценности, философию, характер бренда.\u003Cbr\u003EВ&nbsp;качестве примера отличного логотипа можно привести символику курьерской службы FedEx. Это по-настоящему легендарный лого, который за&nbsp;четверть века собрал более 40&nbsp;наград!\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E2. Товарный знак. \u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EВ&nbsp;непрофессиональной среде между товарным знаком и&nbsp;логотипом зачастую ставят знак равенства. Но&nbsp;это неправильно. Во-первых, лого нельзя официально зарегистрировать. Он&nbsp;охраняется только законом об&nbsp;авторском праве. Товарный знак можно запатентовать. После этого он&nbsp;признается интеллектуальной собственностью и&nbsp;защищается имущественным правом. Во-вторых, товарный знак может быть не&nbsp;только визуальным. В&nbsp;качестве такового регистрируется текстовая запись, звук, объемная форма и&nbsp;т.&nbsp;д.\u003Cbr\u003EК&nbsp;примеру, контурная стеклянная бутылка Coca-Cola является официально зарегистрированным товарным знаком.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E3. Слоган.\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EЭто короткая, емкая, цепляющая фраза, которая увеличивает узнаваемость и&nbsp;запоминаемость бренда. Как и&nbsp;логотип, слоган может быть хорошим и&nbsp;отличным (плохим тоже может, но&nbsp;не&nbsp;будем о&nbsp;грустном). В&nbsp;основе отличного девиза всегда лежит толика креативности. Но&nbsp;главное, это идея, подчеркивающая особенности и&nbsp;преимущества продукта или компании. \u003Cbr\u003EПриведем несколько примеров отличных слоганов без указания брендов. Уверены, вы&nbsp;без подсказок сможете вспомнить, кому они принадлежат. Ведь именно в&nbsp;этом и&nbsp;заключается смысл. Итак, &laquo;Танки грязи не&nbsp;боятся&raquo;, &laquo;Думай иначе&raquo;, &laquo;Бери от&nbsp;жизни все&raquo;, &laquo;Управляй мечтой&raquo;, &laquo;Мы&nbsp;заботимся о&nbsp;вас&raquo;.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E4. Цветовая гамма.\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EЕсли на&nbsp;оживленной улице остановить десять человек и&nbsp;задать им&nbsp;вопрос &laquo;Что такое фирменный стиль?&raquo;, то&nbsp;девять точно вспомнят про корпоративные цвета. Правильно подобранная гамма оттенков привлекает внимание покупателей, выделяет продукцию на&nbsp;полке, способствует запоминаемости бренда. Обратите внимание! Нельзя выбрать два-три цвета и&nbsp;назвать их&nbsp;фирменными. Во-первых, сначала требуется провести анализ предпочтений целевой аудитории. Во-вторых, нужно хотя&nbsp;бы поверхностно ознакомиться с&nbsp;психологией восприятия цвета.\u003Cbr\u003EПримером положительного влияния цветовой гаммы можно считать историю Pepsi. Исходно ее&nbsp;фирменная символика была красного цвета. После смены основного оттенка на&nbsp;синий, продажи газировки увеличились на&nbsp;10%. Причина&nbsp;&mdash; эффективное дистанцирование от&nbsp;главного конкурента.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cstrong\u003E5. Шрифты.\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\r\n\u003Cp\u003EОни не&nbsp;обязательно должны быть уникальными. В&nbsp;большинстве случаев достаточно типовых. При этом не&nbsp;забывайте, что с&nbsp;помощью шрифта можно подчеркнуть те&nbsp;или иные особенности бренда. В&nbsp;частности, курсив намекает на&nbsp;динамичность и&nbsp;движение, засечки делают акцент на&nbsp;стабильности и&nbsp;т.&nbsp;д.&nbsp;На&nbsp;первый взгляд может показаться, что шрифт&nbsp;&mdash; это мелочь. Но&nbsp;не&nbsp;стоит его недооценивать. Как и&nbsp;другие элементы фирменного стиля, он&nbsp;увеличивает узнаваемость бренда.\u003Cbr\u003EПростой пример. Представьте, что Coca-Cola изменила привычный шрифт на&nbsp;любой другой. Это приведет к&nbsp;невероятной путанице! А&nbsp;кое-кто и&nbsp;вовсе откажется от&nbsp;покупки, решив, что перед ним подделка.\u003C\u002Fp\u003E\r\n\u003Cp\u003EПомимо основных составляющих корпоративного стиля существуют и&nbsp;вспомогательные. Причем их&nbsp;список намного обширнее. В&nbsp;него входят маскот (фирменный персонаж), гимн, знамя, особенности товарной выкладки, звуковая фраза и&nbsp;другие элементы, работающие на&nbsp;узнаваемость бренда.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg\u003E\u003C\u002Fp\u003E\r\n\u003Ch3\u003EНосители фирменного стиля\u003C\u002Fh3\u003E\r\n\u003Cblockquote\u003EВажный момент! Постоянное и&nbsp;повсеместное использование фирменной символики&nbsp;&mdash; обязательное условие. Причем очень важно сохранить единообразие всех составляющих. В&nbsp;решении этой задачи помогает брендбук. Книга бренда содержит подробное описание каждого элемента, а&nbsp;также примеры правильного и&nbsp;недопустимого использования. Благодаря этому глобальные бренды защищены от&nbsp;размытия и&nbsp;остаются одинаковыми не&nbsp;только в&nbsp;разных странах, но&nbsp;и&nbsp;на&nbsp;разных континентах.\u003C\u002Fblockquote\u003E\r\n\u003Cp\u003EВпрочем, вернемся к&nbsp;носителям. Большую часть из&nbsp;них можно условно разделить на&nbsp;шесть групп:\u003C\u002Fp\u003E\r\n\u003Col\u003E\r\n\u003Cli\u003E\u003Cstrong\u003EДеловая документация.\u003C\u002Fstrong\u003E К&nbsp;этой категории относят любые фирменные бумаги, включая счет-фактуру, договор, отчет, прайс-лист, акт приема-передачи и&nbsp;др. Документы с&nbsp;корпоративной символикой выглядят более солидно. Они не&nbsp;только улучшают запоминаемость бренда, но&nbsp;и&nbsp;формируют положительный имидж компании.\u003C\u002Fli\u003E\r\n\u003Cli\u003E\u003Cstrong\u003EСувенирная продукция.\u003C\u002Fstrong\u003E Промо-подарок&nbsp;&mdash; отличная площадка для размещения логотипа, слогана и&nbsp;других корпоративных элементов. Используя в&nbsp;повседневной жизни блокнот, ручку, брелок, пакет или зажигалку с&nbsp;вашим логотипом, потребитель будет невольно рекламировать бренд или продукт.\u003C\u002Fli\u003E\r\n\u003Cli\u003E\u003Cstrong\u003EУниформа сотрудников.\u003C\u002Fstrong\u003E Логотип, слоган, изображение фирменного персонажа размещают на&nbsp;бейсболках, футболках, толстовках, фартуках и&nbsp;любой другой рабочей одежде. В&nbsp;этом случае корпоративная символика не&nbsp;только создает положительный образ, но&nbsp;и&nbsp;упрощает идентификацию персонала для потребителей.\u003C\u002Fli\u003E\r\n\u003Cli\u003E\u003Cstrong\u003EРекламная и&nbsp;презентационная полиграфия.\u003C\u002Fstrong\u003E Эта группа включает в&nbsp;себя листовки, буклеты, каталоги, визитки, плакаты и&nbsp;т.&nbsp;д.&nbsp;Такая продукция востребована как во&nbsp;время рекламных кампаний и&nbsp;промо-акций, так и&nbsp;на&nbsp;выставках, конференциях, других профильных мероприятиях.\u003C\u002Fli\u003E\r\n\u003Cli\u003E\u003Cstrong\u003EИнтерьер и&nbsp;навигация.\u003C\u002Fstrong\u003E Цвет и&nbsp;другие элементы визуализации бренда широко используют в&nbsp;оформлении пространств. К&nbsp;примеру, офисы Сбера оформлены в&nbsp;фирменной зеленой гамме, а&nbsp;ВТБ в&nbsp;синей. Благодаря этому посетители с&nbsp;первого взгляда понимают, в&nbsp;какой банк попали.\u003C\u002Fli\u003E\r\n\u003Cli\u003E\u003Cstrong\u003EУпаковка и&nbsp;этикетка.\u003C\u002Fstrong\u003E Выбирая продукт в&nbsp;супермаркете, потребитель максимально плотно контактирует с&nbsp;коробками, бутылками, пакетами и&nbsp;другой тарой. Именно поэтому для товарных брендов упаковка является одним из&nbsp;наиболее важных носителей фирменного стиля.\u003C\u002Fli\u003E\r\n\u003C\u002Fol\u003E\r\n\u003Cp\u003EПеречислить все виды носителей корпоративной символики невозможно, ведь каждый бренд индивидуален и&nbsp;нуждается в&nbsp;особом подходе. Кому-то требуется сайт, кто-то планирует разместить рекламу на&nbsp;билбордах, у&nbsp;третьих в&nbsp;планах установка фирменной Газели на&nbsp;оживленной улице. Вариантов огромное множество! Впрочем, какое&nbsp;бы размещение вы&nbsp;не&nbsp;планировали, сначала необходимо создать фирменный стиль. Теоретически это можно сделать самостоятельно. Но&nbsp;лучше заказать профессиональную разработку. Участие специалистов станет гарантом эффективности логотипа, цветовой гаммы и&nbsp;других элементов визуализации.\u003C\u002Fp\u003E\r\n\u003Cp\u003EХотите, чтобы фирстиль работал на&nbsp;благо компании? Воспользуйтесь услугами брендингового онлайн-сервиса Brand hub. Чтобы получить более подробную информацию и&nbsp;уточнить условия, свяжитесь с&nbsp;нами по&nbsp;телефону: +7 (916) 325-42-24.\u003C\u002Fp\u003E\r\n\u003Cp\u003E\u003Cimg src=\"data:image\u002Fpng;base64,iVBORw0KGgoAAAANSUhEUgAABLAAAAKACAYAAACMi4FYAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAWCCSURBVHgB7N0HnFxneS7w57SpO9urerVkueOGjY0L3TQ71AuEmFwINcEEDIQUICRASAAnhA4XCMR0jCk23Tbu3ZZkW7K6VtpeppfTvvt93zmzu5JlcMW70vP3Hc3saTM7o\\u002Fcd\u002FLB\u002FZtUs+msbw8Ajq+ToGjl6BlN6bljf1qB4fnZo5r55K4aTzz0e9XsdvfnO79bnPfWyf3Ow391\u002F+8xvaXvPCs\u002FLyoSlvYs5TqseP9PvJ3POMg35+WIZhCMmWDwM8Cuo8EBERERERERERERERERERERERERERERERERER0VNBCGGCiIiIiIiIiIhoPtq+fXvvO97x7heAiIiIiA47\u002FFdKIiIiWvCEEMb4+Ph\u002F79+\u002Fpx9EREREdNhhgEVEREQL3h133PGqfH76ZR257jyIiIiI6LDDAIuIiIgWvFQ6\u002FY7x8XHzuONOnwYREREREREREdF88otf\u002FO6E+x\\u002FulE7\u002F6\u002F765621v+5vd73nf+948ODjYCSIiIjrsMcAiIiKihcswOi